import './App.css';
import { Home, Box } from './element';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Link to="/">Home</Link>
        <Link to="/box">Box</Link>
        <Routes>
          <Route path='/' exact element={<Home />} />
          <Route path='/box' exact element={<Box />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
